import { combineReducers } from "redux";

import {
  findUnitById,
  findUnits,
  deletedById,
  saveUnit,
  addUnits
} from "./units";

import {
  findTransactionsById,
  findTransactions,
  deletedTransactionsById,
  editTransactionById,
  addTransactions
} from "./transactions";

import {
  findStocksById,
  findStocks,
  deletedStockById,
  saveStock
} from "./stocks";

import { findItemById, findItems, deletedItemById, saveItems } from "./items";

export default combineReducers({
  deletedById,
  findUnitById,
  findUnits,
  saveUnit,
  addUnits,
  findTransactionsById,
  findTransactions,
  deletedTransactionsById,
  findStocksById,
  findStocks,
  deletedStockById,
  saveStock,
  findItemById,
  findItems,
  deletedItemById,
  saveItems
});
